import React from 'react';
import './index.css';

function SideBar() {
  return (
    <div className='sidebar'>
      <h3>Manage</h3>
      <h4>Sessions</h4>
      <h4>Threshold Sets</h4>
      <h4>Questionnaire</h4>
      <h4>AI Model</h4>
    </div>
  );
}

export default SideBar;
